import React, {Component} from 'react';
import Teams from "./Teams";
import Parallax from "./Parallax";
import Counter from "./Counter";
import Topservice from "./Topservice";
import Advantage from "./Advantage";
import Client from "./Client";
import Title from "./Title";

class About extends Component {
    render() {
        return (
            <div>
                <Title tieude="Đội ngũ giàu kinh nghiệm" colr="tomato" kieucd="zoom-out-down"/>
                <Teams/>
                <Title tieude="Nổi bật" colr="cornflowerblue" kieucd="fade-down"/>
                <Advantage/>
                <Title tieude="Thông số cơ bản" colr="deepskyblue" kieucd="fade-up"/>
                <Counter/>
                <Title tieude="Đối tác của chúng tôi" colr="navy" kieucd="zoom-out-down"/>
                <Client/>
                <Parallax/>
            </div>
        );
    }
}

export default About;
